import logo from "./logo.svg";
import "./App.css";

const App = () => {
  return (
    <div className="app-wrapper">
      <header className="">
        <div className="img_logo">
          <img src="https://catherineasquithgallery.com/uploads/posts/2021-03/1614604873_40-p-avatarki-na-belom-fone-49.png"></img>
        </div>
      </header>
      <nav>
        <div>Profile</div>
        <div>Messages</div>
        <div>News</div>
        <div>Music</div>
        <div>Settings</div>
      </nav>
      <div className="content">Main content</div>
    </div>
  );
};

export default App;
